import styled from 'styled-components';


let StyledContainer = styled.div`
width:400px;
height:700px;
background-color:red;
margin:0 auto;
display:flex;
justify-content:center;
flex-direction:column;
`;

const SignUpPopup = () => {
    return (
        <StyledContainer>
            <button>Signup with anouther program</button>
            <button>hi</button>
        </StyledContainer>
    )
}
export default SignUpPopup;
